import React from 'react';
import Videoitem from '../video_item/video_item';


function Videolist (props) {
    // const [video]= useState(['ddd']);
    <ul>
        {props.videos.map(video => (
            <Videoitem 
            key={video.id} 
            video={video} 
            />
        ))}
    </ul>
}

export default Videolist;
